import React from "react";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";
import Autosuggest from "react-autosuggest";

class Main extends React.Component {
  render() {
    return (
      <React.Fragment>
        <div className="Text">
          <Autosuggest
            className="TextField"
            label="Enter title"
            variant="outlined"
          />
          <TextField
            className="TextField"
            label="Enter branch"
            variant="outlined"
          />
          <TextField
            className="TextField"
            label="Enter artist"
            variant="outlined"
          />
          <TextField
            className="TextField"
            label="Enter decade"
            variant="outlined"
          />
        </div>
        <div className="Button">
          <Button variant="contained" color="secondary">
            Submit
          </Button>
        </div>
      </React.Fragment>
    );
  }
}

export default Main;
